import React from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import { createBrowserHistory } from "history";
import Home from "../pages/Home";

// const Home: React.FC = () => <h2>Home Page</h2>;
const About: React.FC = () => <h2>About Page</h2>;
const Contact: React.FC = () => <h2>Contact Page</h2>;

const MainNavigation: React.FC = () => {
  const history = createBrowserHistory();

  const handleButtonClick = (path: string) => {
    // Use React Router's history to navigate programmatically
    history.push(path);
  };

  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
            <li>
              <Link to="/contact">Contact</Link>
            </li>
          </ul>
        </nav>

        <button onClick={() => handleButtonClick("/about")}>Go to About</button>

        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/contact" element={<Contact />} />
      </div>
    </Router>
  );
};

export default MainNavigation;
